import React from "react";
import Sidebar from "./Sidebar";
import Hero from "./Hero";
import Courses from "./Courses";
import Footer from "./Footer";
import "./App.css";

function App() {
  return (
    <div className="app-container">
      <Sidebar />
      <main className="main-content">
        <Hero />
        <Courses />
        <Footer />
      </main>
    </div>
  );
}

export default App;
